import React from "react";
import { Link } from "react-router-dom";

interface HomeProps {}

export const Home: React.FC<HomeProps> = ({}) => {
  return (
    <div>
      <Link to="/register">register </Link>
      <Link to="/login">login</Link>
    </div>
  );
};
